struct Solution;
const MODULO: i32 = 1_000_000_007;

#[derive(Clone, Debug)]
struct TreeNode {
    left_end_empty: i32,
    right_end_empty: i32,
    no_end_empty: i32,
    both_end_empty: i32,
}

#[derive(Clone, Debug)]
struct Query {
    position: usize,
    number: i32,
}

impl Solution {
    pub fn maximum_sum_subsequence(nums: Vec<i32>, queries: Vec<Vec<i32>>) -> i32 {
        let length = Self::revalue(nums.len());

        let mut tree = vec![
            TreeNode {
                both_end_empty: 0,
                left_end_empty: 0,
                right_end_empty: 0,
                no_end_empty: 0
            };
            2 * length
        ];

        for (num, idx) in nums.into_iter().zip(length..) {
            tree[idx].no_end_empty = num.max(0);
        }

        for parent in (1..length).rev() {
            tree[parent] = Self::merge(&tree[2 * parent], &tree[2 * parent + 1]);
        }

        queries
            .into_iter()
            .map(|query| Query {
                position: query[0] as usize,
                number: query[1],
            })
            .fold(0, |sum, Query { position, number }| {
                let mut index = position + length;
                tree[index].no_end_empty = number.max(0);

                while index > 1 {
                    index /= 2;

                    tree[index] = Self::merge(&tree[2 * index], &tree[2 * index + 1]);
                }

                (tree[1].no_end_empty + sum) % MODULO
            })
    }

    pub fn revalue(length: usize) -> usize {
        let std = 1;
        for expo in 1.. {
            if (std << expo) > length {
                return std << expo;
            }
        }

        unreachable!()
    }

    pub fn merge(left: &TreeNode, right: &TreeNode) -> TreeNode {
        TreeNode {
            both_end_empty: (left.both_end_empty + right.right_end_empty)
                .max(left.left_end_empty + right.both_end_empty)
                % MODULO,
            left_end_empty: (left.left_end_empty + right.left_end_empty)
                .max(left.both_end_empty + right.no_end_empty)
                % MODULO,
            right_end_empty: (left.right_end_empty + right.right_end_empty)
                .max(left.no_end_empty + right.both_end_empty)
                % MODULO,
            no_end_empty: (left.right_end_empty + right.no_end_empty)
                .max(left.no_end_empty + right.left_end_empty)
                % MODULO,
        }
    }
}

